const tabsBtn=document.querySelectorAll(".tabs__nav-btn"),tabsItems=document.querySelectorAll(".tabs__item");tabsBtn.forEach(e=>{e.addEventListener("click",()=>{var t=e,a=t.getAttribute("data-tab"),a=document.querySelector(a);tabsBtn.forEach(t=>{t.classList.remove("tab-active")}),tabsItems.forEach(t=>{t.classList.remove("tab-active")}),t.classList.add("tab-active"),a.classList.add("tab-active")})});